prefix = 'hello ';
function handleNode(context) {
  var org_unit = JSON.parse(context.getParam('org'));
  var sprints = JSON.parse(context.getParam('sprints'));
  // levelops.serviceName().doSomething() - invoke a levelops service

  var children_org_units = [];
  var children_org_unit_filters = [];
  var children_org_unit_paths = [];
  var parent_org_unit_names = [];
  var name = org_unit.name;

  var year, quarter;

  sprints.forEach(function(sprint){
    year = sprint.name.slice(2,4);
    quarter = sprint.name.slice(4,6);
    var number = sprint.name.slice(7,8);

    // year OU
    var year_ou = (name + " " + "FY " + year).trim();
    if(!children_org_units.includes(year_ou)) {
      children_org_units.push(year_ou);
      children_org_unit_filters.push(2000 + parseInt(year) + "");
      parent_org_unit_names.push(org_unit.name);    
    }

	var qtr_ou = (name + " " + "FY " + year + " - " + quarter).trim();
    if(!children_org_units.includes(qtr_ou)) {
      children_org_units.push(qtr_ou);
      children_org_unit_filters.push(("FY"+ year + quarter).trim());
      parent_org_unit_names.push(year_ou);
    }

    var sprint_name = name + " " + "FY " + year + " - " + quarter + "." + "Sprint " + number;
    if (!children_org_units.includes(sprint_name)){
      children_org_units.push(sprint_name.trim());
      children_org_unit_filters.push(("FY"+ year + quarter + "." + number).trim());
      parent_org_unit_names.push(qtr_ou);
    }

  });


  return { 
    state : 'success',
    output : { 
      'children_org_units' : children_org_units,
      'children_org_unit_filters': children_org_unit_filters,
      'children_org_unit_paths': children_org_unit_paths,
      parent_org_unit_names: parent_org_unit_names
    } 
  };
}

